import React, {useState} from 'react'
import {AiOutlineMenu, AiOutlineClose} from 'react-icons/ai'
const Navbar = () => {
    const [nav, setNav] = useState(false)

    const handleNav = () => {
        setNav(!nav)
    }
  return (
    <div className='bg-black text-gray-400 h-[100px] max-w-[1200px] m-auto flex justify-between items-center'>
        <h1 className='text-3xl font-bold primary-color ml-4'>Youssef</h1>
        <ul className='hidden md:flex'>
            <li className='p-5'><a href="">About</a></li>
            <li lassName='p-5'><a href="">Projects</a></li>
            <li lassName='p-5'><a href="">Contact</a></li>
        </ul>
        <div onClick={handleNav} className='block md:hidden'>
            {nav ? <AiOutlineClose size={20}/> : <AiOutlineMenu size={20} className='text-white'/>}
        </div>



    </div>
  )
}

export default Navbar
